import React, { Component } from 'react';

import {
  Wrapper,
  Title,
  Input,
} from '../../../styled-components/player-modal.styled-components';

export default class Player extends Component {
  constructor(props) {
    super(props);
    this.state = {
      player: '',
    };
  }

  render() {
    return (
      <>
        <Wrapper>
          <div className="container">
            <div className="row">
              <div className="col-12">
                <Title>Player Name</Title>
                <form>
                  <Input />
                </form>
              </div>
            </div>
          </div>
        </Wrapper>
      </>
    );
  }
}
